import React, { Component } from 'react';

class CreateLocationComponent extends Component {

    constructor(props){
        super(props)
        
        this.state = {
            idLocation: '',
            country: '',
            province: '',
            district: '',
            subDistrict: '',
            group: '',
            numberHome: ''
        }
    }

    render() {
        return (
            <div>
                <h1>Location Form</h1>
            </div>
        );
    }
}

export default CreateLocationComponent;
